  // We should always put empty label entry first after sorting
  if (labelName.isEmpty() != o.getLabelName().isEmpty()) {
    if (labelName.isEmpty()) {
      return -1;
    }
    return 1;
  }

  return labelName.compareTo(o.getLabelName());
}
